import React from 'react';
import Card from "./Card";
import sdata from "./Sdata";

function App(){
    return(
        <>
    <h1 className="heading">Below is the list of Series</h1>
    <Card imgscr={sdata[0].imgscr}
    title={sdata[0].title}
    sname={sdata[0].sname}
    link={sdata[0].link}
    />
    
    <Card imgscr={sdata[1].imgscr}
    title={sdata[1].title}
    sname={sdata[1].sname}
    link={sdata[1].link}
    />
    
    <Card imgscr={sdata[2].imgscr}
    title={sdata[2].title}
    sname={sdata[2].sname}
    link={sdata[2].link}
    />
    
    </>
    );
}
export default App;
